import React from './react';

class Counter extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      count: 0
    };
    console.log('count', this.state);
  }
  
  render() {
    return <div onClick={() => {
      this.setState({
        count: this.state.count + 1
      });
    }} >
      count: {this.state.count}
    </div>;
  }
}

export default Counter;
